import initialState from './initialState';
import { FETCH_PARTIES, RECEIVE_PARTIES, CHANGE_CURRENT_PARTIE } from '../actions/actionTypes';

export default function parties(state = initialState.parties, action) {
  switch (action.type) {
    case FETCH_PARTIES:
      return action;

    case RECEIVE_PARTIES:
      return {
        ...state,
        parties: action.parties
      }

      case CHANGE_CURRENT_PARTIE:
        return {
          ...state,
          currentPartie: action.partie
        }

    default:
      return state;
  }
}
